  \begin{tabular}{l}
    {\sf \rule{0.5cm}{0pt}x[i]=inx[index2*index4+index*3+i];}\\
  \end{tabular}
\end{center}  
for {\sf i=0,1,2} where {\sf inx} corresponds to the vector {\sf devx}. The direction for 
the derivatives is given by {\sf index1}.
